import React from 'react'
import ReactDom from 'react-dom'
import Card from './Cards'
import Sdata from './Sdata'
function ncard(val){
return (
  <Card 
    imgsrc={val.imgsrc}
    title={val.title}
    sname={val.sname}
    link={val.link}
  />
)
}

ReactDom.render(
  <> 
  <h1>List of top 5 in 2022</h1>
  Sdata.map(ncard);
  </>
  ,
  document.getElementById('root')
);
